import React, { useState } from 'react';
import { Button, Form, Input, Row, Col, Image, Typography, Modal, Radio  } from 'antd';

export default function IdentityCard() {

  const [value, setValue] = useState('male');
  const onChange = (e) => {
    console.log('radio checked', e.target.value);
    setValue(e.target.value);
  };

  return (
    <div className='id'>
      <Row>

      <h1>Tờ khai căn cước công dân trực tuyến</h1>
      </Row>
      {/* 
      - Họ tên : text - giới tính : radio
      - ngày tháng năm sinh : date - Nơi đăng ký khai sinh: text
      - số CCCD/CMND : number (10 hoặc 12 số)
      - Dân tộc : text - Tôn giáo : text - Quốc tịch : text
      - Tình trạng hôn nhân : radio
      - Quê quán : text
      - Nơi thường trú : text
      - Nơi ở hiện tại : text
      */}
      <Row>

        <Form
          name="basic"
          labelCol={{ span: 8 }}
          wrapperCol={{ span: 16 }}
          style={{ maxWidth: 600 }}
          initialValues={{ remember: true }}
          
          autoComplete="off"
        >
          <Form.Item
            label="Họ và tên: "
            name="fullname"
            rules={[{ required: true, message: 'Please input your fullname!' }]}
          >
            <Input placeholder='Nhập họ và tên'  />
            <Radio.Group onChange={onChange} value={value}>
              <Radio value={'male'}>Nam</Radio>
              <Radio value={'female'}>Nữ</Radio>
      
            </Radio.Group>
 
          </Form.Item>
          <Form.Item
            label="Họ và tên: "
            name="fullname"
            rules={[{ required: true, message: 'Please input your fullname!' }]}
          >
            <Input placeholder='Nhập họ và tên'  />
          </Form.Item>
          <Form.Item
            label="Họ và tên: "
            name="fullname"
            rules={[{ required: true, message: 'Please input your fullname!' }]}
          >
            <Input placeholder='Nhập họ và tên'  />
          </Form.Item>
          
        </Form>
      </Row>
      

    </div>
  )
}
